import {client} from "../utils/axios";
import {useState} from "react";
import {useAuthStore} from "../stores/authStore";
import {useNavigate} from "react-router-dom";

export default function Login() {
  const {login} = useAuthStore();
  const navigate = useNavigate();

  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const loginHandler = async (ev) => {
    ev.preventDefault();
    try {
      const { data } = await client.post('/auth/login', {
        username,
        password,
      });

      console.dir(data)
      login(data.data.accessToken, data.data.roles);
      navigate('/');
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <>
      <form className="col s12" method="post"
            id="signupForm" onSubmit={loginHandler}>
        <div className="row">
          <div className="input-field col s7 ">
            <i className="material-icons prefix">account_circle</i>
            <input className="validate" onChange={(e) => setUsername(e.target.value)}/>
          </div>
        </div>
        <div className="row">
          <div className="input-field col s7 ">
            <i className="material-icons prefix">account_circle</i>
            <input  placeholder="password" className="validate" onChange={(e) => setPassword(e.target.value)}/>
            <span className="helper-text"></span>
          </div>
        </div>
        <div className="row">
          <button className="btn waves-effect waves-light offset-s1"
                  id="btnForm" name="action">
            Submit
            <i className="material-icons right">send</i>
          </button>
        </div>
      </form>
    </>
  )
}
